import React, {Component} from "react";
import Background from "../backgroundComponent/Background";
import "../../assets/css/aboutPage.css";
import AboutInfoComponent from "../aboutPageComponent/AboutInfoComponent";

var start = "0,0 70,0 60,40 50,60 40,100 0,100",
    end   = "0,0 25,0 20,20 20,80 15,100 0,100";

class AboutPage extends Component{
    render() {
        return(
            <div className={"aboutPage"}>
                <Background start={start} end={end}/>

                <div className={"content"}>
                    <AboutInfoComponent/>
                </div>
            </div>
        );
    }
}

export default AboutPage;

